import React, { useState } from 'react'
import {useNavigate} from 'react-router-dom';
import busService from '../service.js/busService';

const Register = () => {

 const [username, setUsername] = useState('');
 const [emailId, setEmailId] = useState('');
 const [phoneNumber, setPhoneNumber] = useState('');
 const [password, setPassword] = useState('');
 const navigate = useNavigate();

 const Login=()=>{
  navigate("/log-in");
 }

 const Submit=(e)=>{
  e.preventDefault();
  var user = {username, phoneNumber, emailId, password}
  console.log(user);
  userS.addUser(user).then((response)=>{
   console.log(response.data);
   Login();
  }).catch(error=>{
   console.log(error);
  })
 }

  return (
    <div>
      <div className='p-5'></div>
     <div className = "container">
                <div className = "row">
                    <div className = "card col-md-6 offset-md-3 offset-md-3">
                       <h2 className = "text-center">New User Registration</h2>
                        <div className = "card-body">
                            <form>

                             <div className = "form-group mb-2">
                                    <label className = "form-label"> Username </label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter your username"
                                        name = "username"
                                        className = "form-control"
                                        value = {username}
                                        onChange = {(e) => setUsername(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Phone Number </label>
                                    <input
                                        type = "text"
                                        placeholder = "Enter your Phone Number"
                                        name = "phoneNumber"
                                        className = "form-control"
                                        value = {phoneNumber}
                                        onChange = {(e) => setPhoneNumber(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> EmailId </label>
                                    <input
                                        type = "email"
                                        placeholder = "Enter your Email Id"
                                        name = "emailId"
                                        className = "form-control"
                                        value = {emailId}
                                        onChange = {(e) => setEmailId(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className = "form-group mb-2">
                                    <label className = "form-label"> Password :</label>
                                    <input
                                        type = "password"
                                        placeholder = "Enter your password"
                                        name = "password"
                                        className = "form-control"
                                        value = {password}
                                        onChange = {(e) => setPassword(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <button className = "btn btn-success" onClick = {(e) => Submit(e)} > Add  </button>
                                <div className='side-by-side'>
                                 <h4 >Already has an account?</h4>
                                 <div className='p-1'></div>
                                 <button className = "btn btn-success" onClick = {() => Login()} > Back to Login Page </button>
                                </div>
                            </form>

                        </div>
                    </div>
                </div>

           </div>
           <div className='p-5'></div>
           <div className='p-5'></div>
    </div>
  )
}

export default Register
